import React from "react";
import ReactDOM from "react-dom";

const App = () => {
    return(
        <div className="App">

            <ul>
                <li>Facebook</li>
                <li>Youtube</li>
                <li>Instagram</li>
            </ul>
        </div>
    )
}

export default App;
